Автоспорт для iOS от Sports.ru - все новости, аналитические материалы и интервью #прямосейчас, а также платформа для общения с другими болельщиками. 
Текстовые онлайн трансляции, календарь заездов и детальная статистика обязательно появятся в следующих версиях приложения.

В текущей версии приложения вы найдете:

• Новости, анонсы, тексты лучших спортивных журналистов и интервью;
• Блоги, материалы пользователей Sports.ru и много другого эксклюзивного контента;
• Фото, Gif и видео гонок;
• Чаты для общения с другими болельщиками.
